import React from 'react';
import { Container } from '@material-ui/core';
import Header from './components/Header';
import Quiz from './components/Quiz';
import './App.css';

function App() {
  return (
    <div className="App">
      <Header />
      <Container maxWidth="md">
        <Quiz />
      </Container>
    </div>
  );
}

export default App;
